The Beatles - Something [original promo].VOB


HQ very rare promo music video from a promo DVD. &quot;Something&quot; is a song by the Beatles, featured on their 1969 album Abbey Road. It was released that same year as a double A-sided single with another track from the album, &quot;Come Together&quot;. &quot;Something&quot; was the first Beatles song written by lead guitarist George Harrison to appear as an A-side, and the only song written by him to top the US charts while he was in the band. The single was also one of the first Beatles singles to contain tracks already available on an LP album.

John Lennon and Paul McCartney, the band's principal songwriters, both praised &quot;Something&quot; as one of the best songs Harrison had written, or that the group had to offer. As well as critical acclaim, the single achieved commercial success, topping the Billboard charts in the United States and making the top five in the United Kingdom. The song has been covered by over 150 artists, making it the second-most covered Beatles song after &quot;Yesterday&quot;. Artists who have covered the song include Elvis Presley, Frank Sinatra, Ray Charles, James Brown, Shirley Bassey, Tony Bennett, Andy Williams, Ike &amp; Tina Turner, The Miracles, Eric Clapton, Joe Cocker, Isaac Hayes, Julio Iglesias, Mina, and Phish. Harrison is quoted as saying that his favourite version of the song was James Brown's, which he kept in his personal jukebox.

Promotional video:

The promotional video for &quot;Something&quot; was shot shortly before the break-up of the band. By this time, the individual Beatles had drawn apart and so the film consisted of separate clips of each Beatle walking around his home, accompanied by his wife, edited together. The film was directed by Neil Aspinall.

Reception:

The Abbey Road album was the first Beatles release to feature &quot;Something&quot;; it was released on 26 September 1969 in the United Kingdom, with the United States' release following on 1 October, and performed well, topping the charts in both countries.


The Beatles were an English rock band formed in Liverpool in 1960. They became the most commercially successful and critically acclaimed act in the rock music era. The group's best-known lineup consisted of John Lennon, Paul McCartney, George Harrison, and Ringo Starr. Rooted in skiffle and 1950s rock and roll, the Beatles later utilized several genres, ranging from pop ballads to psychedelic rock, often incorporating classical and other elements in innovative ways. In the early 1960s, their enormous popularity first emerged as &quot;Beatlemania&quot;, but as their songwriting grew in sophistication, they came to be perceived by many fans and cultural observers as an embodiment of the ideals shared by the era's sociocultural revolutions. 
